title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o19702.m6 -> o19672.m16 -> o19702.m8 -> o19672.m16
  o19702.m8 -> o19672.m16 -> o19702.m8
  o19672.m16 -> o19702.m8 -> o19672.m16
  o19702.m2 -> o19672.m16 -> o19702.m8 -> o19672.m16

features:
  - inheritance
  - overriding
  - method
  - polymorphism

